sys_variable_value.value:
(function execute(inputs, outputs) {
var glideRec=inputs.Record;  
for (var key in glideRec)
{ 
    if(key=='variables')
    {
        var ob={};
        var vars=glideRec[key]
        for(var vi in vars)
        {
            ob[vi]=vars[vi]+'';
        }
      ob.tableName=glideRec.getTableName();

    }

}
outputs.variables= (JSON.stringify(ob));

})(inputs, outputs);

